Taylor Wane - Mommy Will Take Care Of It

Added: February 11, 2011

Size:  509 Mb

Taylor\'s daughter is upset that they\'re running late for her wedding;s day booking. When they walk in to book the hall, Jordan tells them that there are no open dates for the next nine months. Taylor\'s daughter panics immediately and leaves the room. Once alone with Jordan, Taylor will do whatever it takes to make sure her daughter gets the hall she wants for her wedding.

